import styled from "styled-components";
import { MdClose } from "./MdClose";

const CloseButton = styled.button`
  position: fixed;
  right: 0;
  z-index: 4;
  background-color: transparent;
  border: none;
  color: white;
  font-size: 2em;
  margin: 0.5em;
`;

export default CloseButton;
